import PropTypes from 'prop-types';
import { withStyles } from '@material-ui/core/styles';
import red from '@material-ui/core/colors/red';
import { ZiggeoRecorder } from 'react-ziggeo'; 
import Recorder from 'react-recorder';
// import {
