            color="secondary"
            onClick={() => this.handlStopRecorder()}
          >
            <Icon className={`icon_button ${classes.icon}`} >stop</Icon>
            End Recorder
          </Button>
        </div> */}
      </div>
    )
  }
}

RecorderVideo.propTypes = {
  classes: PropTypes.object.isRequired,
};

export default withStyles(styles)(RecorderVideo);
